import React, { Component } from 'react';
import logo from './logo.svg';


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">

          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>


        </header>
      </div>
    );
  }
}

export default App;
